    margin: 0 auto;
    
}

.arrow-4 {
    display: none;
    z-index: 2;
}

.bio-img {
    width: auto;
    margin: 0 auto;
}

@media only screen and (min-width: 1000px) {
    .bio-container {
        position: relative;
        height: auto;
        background: var(--purple-grad-bg);
    }
    .arrow-4 {
        display: unset;
        position: absolute;
        left: 50%;
        top: 0;
        transform: translate(-300px, -50%);
    }
    .bio-wrapper {
        position: relative;
        width: 1000px;
        margin: 0 auto;
        display: grid;
        grid-template-columns: 1fr 1fr;
        gap: 50px;
        justify-content: center;
        align-items: center;
    }
    .bio {
        position: relative;
        background-color: var(--light-purple);
        padding: 50px;
        color: var(--white);
        
        z-index: 3;
    }  
    .bio h3 {
        color: #fff;
        position: absolute;
        top: 0;
        left: 50%;
        transform: translate(68%, 90%);
        font-size: 15rem;
        z-index: -1;
        filter: opacity(0.7);
        
    }
    .decor {
        position: absolute;
        height: 50px;
        width: 90%;
        background: linear-gradient(90deg, var(--dark-blue), rgba(23, 104, 178,0) ) ;
        z-index: 2;
        bottom: 125px;
        right: 0;
    }
    .bio-img {
        position: relative;
        top: -50px;
        
        z-index: 1;
    }
}

